import React, { useEffect } from 'react'
import { useParams, Link } from 'react-router-dom'
import { ListGroup, Row, Col, Card, Image } from 'react-bootstrap'
import { useSelector, useDispatch } from 'react-redux'
import { fetchOrdersByStaffId } from '../actions/staffAction'
import Loader from '../components/Loader'
import Message from '../components/Message'

const StaOrderListScreen = () => {
  const { id: staffId } = useParams()
  const dispatch = useDispatch()
  const staffOrders = useSelector(state => state.staffOrders)
  const { loading, error, orders } = staffOrders

  useEffect(() => {
    if (staffId) {
      dispatch(fetchOrdersByStaffId(staffId))
    }
  }, [dispatch, staffId])

  const getStatusMessage = (status) => {
    switch (status) {
      case 'Scheduled':
        return { variant: 'info', message: 'Scheduled' }
      case 'Completed':
        return { variant: 'success', message: 'Completed' }
      case 'Cancelled':
        return { variant: 'danger', message: 'Cancelled' }
      case 'No Show':
        return { variant: 'warning', message: 'No Show' }
      default:
        return { variant: 'secondary', message: 'Unknown' }
    }
  }

  const formatDate = (date) => {
    return new Date(date).toLocaleDateString()
  }

  return loading ? (
    <Loader />
  ) : error ? (
    <Message variant='danger'>{error}</Message>
  ) : orders && orders.length > 0 ? (
    orders.map(order => (
      <div key={order._id}>
        <h1 className="text-center">Appointment Num: {order._id}</h1>
        <Row className="justify-content-center">
          <Col md={8}>
            <ListGroup variant='flush'>
              <ListGroup.Item className="text-center">
                <h2>Description of the illness or complain</h2>
                <p>{order.illnessDescription}</p>
              </ListGroup.Item>

              <ListGroup.Item className="text-center">
                <h2>Appointment Request Form</h2>
                {order.orderItems.length === 0 ? (
                  <Message variant="info">Appointment Request Form is Null</Message>
                ) : (
                  <ListGroup variant='flush'>
                    {order.orderItems.map((item, index) => (
                      <ListGroup.Item key={index} className="text-center">
                        <Row className="justify-content-center align-items-center">
                          <Col md={1}>
                            <Image src={item.staff.image} alt={item.staff.name} fluid rounded />
                          </Col>
                          <Col>
                            <Link to={`/staffs/${item.staff._id}`}>{item.staff.name}</Link>
                          </Col>
                          <Col md={3}>
                            <Row>{item.staff.department}</Row>
                            <Row>{item.staff.position}</Row>
                          </Col>

                          <Col md={2}>
                            <Row>
                              <Col>{formatDate(item.date)}</Col>
                              <Col>{item.slot}</Col>
                            </Row>
                          </Col>
                          <Col>
                            <Message {...getStatusMessage(item.status)}>
                              {getStatusMessage(item.status).message}
                            </Message>
                          </Col>
                        </Row>
                      </ListGroup.Item>
                    ))}
                  </ListGroup>
                )}
              </ListGroup.Item>
            </ListGroup>
          </Col>
        </Row>
      </div>
    ))
  ) : (
    <Message variant="info">No orders found.</Message>
  )
}

export default StaOrderListScreen
